//定义默认数据
var ar = ["请选择省份","请选择城市","请选择区县"];
function areaInit(path,obj_1,val_1,obj_2,val_2,obj_3,val_3){
	//初始化
	initData(obj_1,ar[0]);initData(obj_2,ar[1]);initData(obj_3,ar[2]);

	//TODO: 省级数据
	for (i=0;i<qprovince.length;i++)eqAreaForNo(qprovince[i],obj_1,val_1);
	selectValue = $("#"+obj_1).val();
	if(selectValue != -1){
		//TODO: 市数据
		initData(obj_2,ar[1],1);
		for (i=0;i<qcity.length;i++) if(qcity[i].no.indexOf(selectValue) != -1) eqAreaForNo(qcity[i],obj_2,val_2);
		//TODO: 区判断
		selectValue = $("#"+obj_2).val();
		if(selectValue != -1){
			initData(obj_3,ar[2],1);
			for (i=0;i<qarea.length;i++)if(qarea[i].no.indexOf(selectValue) != -1)eqAreaForNo(qarea[i],obj_3,val_3);
		}
	}

	//响应obj_1的change事件
	$("#"+obj_1).change(function(){
		var selectValue = $("#"+obj_1).val();
		if(selectValue == -1){
			initData(obj_2,ar[1],1);initData(obj_3,ar[2],1);return false;
		}
		$("#"+obj_1 + "Name").val($("#"+obj_1+" option:selected").text());
		//TODO: 市数据
		initData(obj_2,ar[1],1);
		for (i=0;i<qcity.length;i++){
			var area = qcity[i];if(area.no.indexOf(selectValue) != -1) {
				$("<option value='"+area.no+"'>"+area.name+"</option>").appendTo($("#"+obj_2));
			}
		}
		//TODO: 区数据
		initData(obj_3,ar[2],1);
	});

	//响应obj_2的change事件
	$("#"+obj_2).change(function(){
		var selectValue = $("#"+obj_2).val();
		if(selectValue == -1){
			initData(obj_3,ar[2],1);return false;
		}
		$("#"+obj_2 + "Name").val($("#"+obj_2+" option:selected").text());
		//TODO: 区数据
		initData(obj_3,ar[2],1);
		for (i=0;i<qarea.length;i++){
			var area = qarea[i];if(area.no.indexOf(selectValue) != -1) {
				$("<option value='"+area.no+"'>"+area.name+"</option>").appendTo($("#"+obj_3));
			}
		}
	});
	$("#"+obj_3).change(function(){
		var selectValue = $("#"+obj_3).val();
		if(selectValue != -1)$("#"+obj_3 + "Name").val($("#"+obj_3+" option:selected").text());
	});
}
/**
 * 省市区初始化时，判断默认值并选中方法
 * @param objArea 省市区对象
 * @param objId   当前选中ID
 * @param objValue  当前选中值
 * @return
 */
function eqAreaForNo(objArea,objId,objValue) {
	if (objArea.no == objValue) {
		$("<option selected value='"+objArea.no+"'>"+objArea.name+"</option>").appendTo($("#"+objId));
		$("#"+objId + "Name").val(objArea.name);
	} else $("<option value='"+objArea.no+"'>"+objArea.name+"</option>").appendTo($("#"+objId));
}

/**
 * 默认初始化方法
 * @param objId  当前ID
 * @param objValue  初始化数组默认值
 * 		ar[0] = 请选择省份
 * 		ar[1] = 请选择城市
 * 		ar[2] = 请选择区县
 * @param isEmpty
 * 		0 不作清空操作标识
 *      1 清空操作标识
 * @return
 */
function initData(objId, objValue,isEmpty) {
	if(isEmpty == 1) $("#"+objId).empty();$("<option value='-1'>"+objValue+"</option>").appendTo($("#"+objId));
}
